import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ProductDetail.css';

const ProductDetail = () => {
  const navigate = useNavigate(); // Initialize useNavigate

  const handleBackClick = () => {
    navigate('/portfolioslist'); // Navigate to /portfolioslist when Back button is clicked
  };

  const handleSavePdfClick = () => {
    // URL or path to the PDF file
    const pdfUrl = '/path/to/your/pdf-file.pdf';
  
    // Trigger the PDF download
    window.open(pdfUrl, '_blank');
  };
  

  const handleViewInARClick = () => {
    window.location.href = 'https://mywebar.com/p/Project_0_qbtprz8dtu'; // Redirect to the AR URL
  };

  return (
    <div className='main_menu_wrapper'>
      <div className="d-flex justify-content-evenly mb-4">
      <button onClick={handleBackClick} style={{ border: 'none'}}>
            Back
          </button>
        <h5 className="black-text">ARJUN'S PORTFOLIOS</h5>
      </div>
      <div className='product-container'>
        <div className='col-12'>
          <img src="/img1.png" alt="Antique Walnut" className="img-fluid product_img" />
          <p className="product_code">Product Code: 12345678A</p>
        </div>
        <div className="row justify-content-center mt-4">
          <div className="col-10 col-md-6">
            <p>
              Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's
              standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to
              make a type specimen book.
            </p>
            <h5>Key Features:</h5>
            <ul>
              <li>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</li>
              <li>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</li>
            </ul>
          </div>
        </div>
        <div>
          <button className="portfolio_btn">
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 576 512" style={{ marginRight: '10px' }}>
              <path fill="#E53935" d="M384 480l48 0c11.4 0 21.9-6 27.6-15.9l112-192c5.8-9.9 5.8-22.1 .1-32.1S555.5 224 544 224l-400 0c-11.4 0-21.9 6-27.6 15.9L48 357.1 48 96c0-8.8 7.2-16 16-16l117.5 0c4.2 0 8.3 1.7 11.3 4.7l26.5 26.5c21 21 49.5 32.8 79.2 32.8L416 144c8.8 0 16 7.2 16 16l0 32 48 0 0-32c0-35.3-28.7-64-64-64L298.5 96c-17 0-33.3-6.7-45.3-18.7L226.7 50.7c-12-12-28.3-18.7-45.3-18.7L64 32C28.7 32 0 60.7 0 96L0 416c0 35.3 28.7 64 64 64l23.7 0L384 480z"/>
            </svg> Save to Portfolio
          </button>

          <button className="portfolio_btn" onClick={handleViewInARClick}>
            <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 120 120">
              <path d="M85.81 120H34.19a8.39 8.39 0 0 1-8.38-8.39V8.39A8.39 8.39 0 0 1 34.19 0h51.62a8.39 8.39 0 0 1 8.38 8.39v103.22a8.39 8.39 0 0 1-8.38 8.39zM34.19 3.87a4.52 4.52 0 0 0-4.51 4.52v103.22a4.52 4.52 0 0 0 4.51 4.52h51.62a4.52 4.52 0 0 0 4.51-4.52V8.39a4.52 4.52 0 0 0-4.51-4.52z"/>
              <path d="M73.7 10.32H46.3L39.28 3.3 42.01.57l5.89 5.88h24.2L77.99.57l2.73 2.73-7.02 7.02zM47.1 103.23h25.81v3.87H47.1z"/>
            </svg> View in AR
          </button>
        
          <button className="portfolio_btn" onClick={handleSavePdfClick}>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">
                <path d="M19 3H5c-1.1 0-2 .9-2 2v14c0 1.1.9 2 2 2h14c1.1 0 2-.9 2-2V5c0-1.1-.9-2-2-2zm0 16H5V5h14v14zm-8-4h2v-2h-2v2zm0-4h2V7h-2v2zm-4 6h10v-1.5H7V15z"/>
            </svg>
            Save PDF
            </button>

        </div>
      </div>
    </div>
  );
};

export default ProductDetail;
